<section class="about" id="about">
<div class="container">
    <div class="row min-vh-100 align-items-center">
        <div class="col-md-6 content" data-aos="fade-right">
            <div class="box">
                <h3> <i class="fas fa-stethoscope"></i> Diagnostic </h3>
                <p>Le médecin pose son diagnostic et prescrit un traitement voire des examens spécifiques (radios, analyses…). Il peut également orienter son patient vers un médecin spécialiste.</p>
            </div>
            <div class="box">
                <h3> <i class="far fa-handshake"></i> Collaboration </h3>
                <p> Nous travaillons en association. Nous collaborons pour vous offrir une meilleure qualité de soins et une plus grande disponibilité.Nous partageons les dossiers de nos patients pour une bonne continuité de soins.</p>
            </div>
            <div class="box">
                <h3> <i class="fas fa-procedures"></i> médicaments </h3>
                <p>Lors d'une consultation chez notre  cabinet  le medecin peut prescrire des médicaments.Le choix d'un médicament dépend de la maladie à traiter, mais aussi du patient. Son âge, ses facteurs de fragilité et ses attentes devront être prises en compte</p>
            </div>
            <div class="box">
                <h3> <i class="fas fa-ambulance"></i> Traitement </h3>
                <p>Le medecin est souvent amené à donner des conseils pour prévenir les maladies et pour être en bonne santé.Il soigne tout le monde, à tout âge, nourrissons, enfants, adultes et personnes âgées.</p>
            </div>
        </div>

